// Categories
import React from 'react';
import './Categories.css';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import FormLabel from '@mui/material/FormLabel';
import FormControl from '@mui/material/FormControl';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormHelperText from '@mui/material/FormHelperText';
import Checkbox from '@mui/material/Checkbox';

export default function Categories() {
  return (
    <section className="categories" id="categories">
         <br/>  <br/>  <br/>  <br/>  <br/>  <br/>

    <center> <h2>Hello,it's great to meet you</h2></center>
    <center> <p>Got a project,just fill out the below from and we will get in touch with you.<br/>
       you can also reach us at hello@orkaapps.com </p></center>
       <br/>
       <br/>
       <br/>
       <TextField
       fullWidth
        id="filled-basic" 
        label="Name"
         variant="filled"
         InputProps={{ style: { fontSize: 30 } }}
        InputLabelProps={{ style: { fontSize: 20 } }}
          />
           <br/>
           <br/>
           <br/>

    <TextField
       fullWidth
        id="filled-basic" 
        label="Mobile number"
         variant="filled"
         InputProps={{ style: { fontSize: 30 } }}
        InputLabelProps={{ style: { fontSize: 20 } }}
          />
           <br/>
           <br/>
           <br/>
              <TextField
       fullWidth
        id="filled-basic" 
        label="Email Address"
         variant="filled"
         InputProps={{ style: { fontSize: 30 } }}
        InputLabelProps={{ style: { fontSize: 20 } }}
          />
          <br/>
          <br/>
           <br/>
              <TextField
       fullWidth
        id="filled-basic" 
        label="Tell us more about your project"
         variant="filled"
         InputProps={{ style: { fontSize: 30 } }}
        InputLabelProps={{ style: { fontSize: 20 } }}
          />
          <br/>
          <br/>
           <br/>
           <hr/>
           <Box sx={{ display: 'flex' }}>
      <FormControl sx={{ m: 3 }} component="fieldset" variant="standard">
        <FormGroup>
          <FormControlLabel
            control={
              <Checkbox  labename="gilad" />
            }

          />
          <FormControlLabel
            control={
              <Checkbox   name="jason" />
            }

          />

        </FormGroup>
        <FormHelperText>Be careful</FormHelperText>
      </FormControl>
      <FormControl
        required
        component="fieldset"
        sx={{ m: 3 }}
        variant="standard"
      >
        <FormLabel component="legend">Pick two</FormLabel>
        <FormGroup>
          <FormControlLabel
            control={
              <Checkbox name="gilad" />
            }
          />
          <FormControlLabel
            control={
              <Checkbox name="jason" />
            }
          />

        </FormGroup>
      </FormControl>
    </Box>
    </section>
  );
}
